import { CardInfo } from 'components/CardInfo/CardInfo';
import user from '../../src/components/user.json';
export const App = () => {
  return (
    <div>
      <CardInfo
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    </div>
  );
};
